    private RcgVotingReceiptCollisionIncident incident;

    /**
    * Creates an incident to test against.
    */
    @BeforeMethod
    public void createRcgVotingReceiptCollisionIncident() {
        incident = new RcgVotingReceiptCollisionIncident(new RcgVotingReceipt(
                    COLLIDING_RCG_VOTING_RECEIPT),
                new VcsEncryptedVote(FIRST_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION),
                new VcsEncryptedVote(SECOND_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION));
    }

    /**
     * Verifies that an IllegalArgumentException is thrown when no
     * encrypted vote is provided.
     */
    @Test(expectedExceptions = IllegalArgumentException.class)
    public void throwsIllegalArgumentExceptionWhenNoEncryptedVoteProvided() {
        new RcgVotingReceiptCollisionIncident(new RcgVotingReceipt(
                COLLIDING_RCG_VOTING_RECEIPT));
    }

    /**
     * Verifies that an IllegalArgumentException is thrown when only one
     * encrypted vote is provided.
     */
    @Test(expectedExceptions = IllegalArgumentException.class)
    public void throwsIllegalArgumentExceptionWhenOnlyOneEncryptedVoteProvided() {
        new RcgVotingReceiptCollisionIncident(new RcgVotingReceipt(
                COLLIDING_RCG_VOTING_RECEIPT),
            new VcsEncryptedVote(FIRST_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION));
    }

    /**
     * Verifies that an IllegalArgumentException is thrown when one of the
     * encrypted appears more than once.
     */
    @Test(expectedExceptions = IllegalArgumentException.class)
    public void throwsIllegalArgumentExceptionWhenAnEncryptedVoteOccursMoreThanOnce() {
        new RcgVotingReceiptCollisionIncident(new RcgVotingReceipt(
                COLLIDING_RCG_VOTING_RECEIPT),
            new VcsEncryptedVote(FIRST_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION),
            new VcsEncryptedVote(FIRST_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION),
            new VcsEncryptedVote(SECOND_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION));
    }

    /**
     * Verifies that an incident is equal to itself.
     */
    @Test
    public void mustBeEqualToItself() {
        assertEquals(incident, incident);
    }

    /**
     * Verifies that an incident has a consistent hashCode.
     */
    @Test
    public void mustHaveSameHashCodeAsItself() {
        assertEquals(incident.hashCode(), incident.hashCode());
    }

    /**
     * Verifies that an incident is not equal to null.
     */
    @Test
    public void mustNotBeEqualToNull() {
        Object nullObject = null;
        assertFalse(incident.equals(nullObject));
    }

    /**
     * Verifies that an incident is not equal to an object of another class. This is used as the test case.
     */
    @Test
    public void mustNotBeEqualToAnObjectOfAnotherClass() {
        assertFalse(incident.equals(this));
    }

    /**
     * Verifies that the incident is equal to another incident with the same
     * voting receipt and encrypted votes.
     */
    @Test
    public void mustBeEqualToAnotherRcgVotingReceiptCollisionIncidentWithTheSameVotingReceiptAndEncryptedVotes() {
        assertEquals(incident,
            new RcgVotingReceiptCollisionIncident(
                new RcgVotingReceipt(COLLIDING_RCG_VOTING_RECEIPT),
                new VcsEncryptedVote(
                    FIRST_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION),
                new VcsEncryptedVote(
                    SECOND_VCS_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION)));
    }

